			"18" = "Recall_On_Open"
			'19' = 'Pinned'
			'20' = 'Unpinned'
			"22" = "Recall_On_DataAccess"
			"28" = "Directory" 
			"31" = "TxF Flag (0x80000000)" # Undocumented
