						# add as parent
						$null = $Parentdict["$($dir.PFileId)"].add($dir)
						# check to see if the key is present already
						if (!$Parentdict["$($dir.FileId)"])
						{
							# add an empty array list 
							$Parentdict["$($dir.FileId)"] = [System.Collections.ArrayList]::new()
						}
					}
					else
					{
